/**
 * Returns a range of numbers based upon the first value and the step value excluding any numbers at or beyond the until value.
 * @param first
 * @param until
 * @param step
 * @returns {number[]}
 */
export default function rangeOfNumbersUntil(first: number, until: number, step?: number): number[];
